import Paper from '@mui/material/Paper';
import Container from '@mui/material/Container';
import Grid from '@mui/material/Grid';

const TourCard = () => {
    return ( 
        <Grid item xs={3}>
            <Paper elevation = {3}>
                <img  src="//upload.wikimedia.org/wikipedia/commons/thumb/a/ab/3Falls_Niagara.jpg/800px-3Falls_Niagara.jpg"
                alt ="Niagra falls" class="img"/>
            </Paper>
        </Grid>
     );
}
 
export default TourCard;
